import React from "react";
import SmartTitle2 from "./SmartTitle2";

function ContactInfo(){
    return(
        <div className="contact-info-container">
           <SmartTitle2 
                className="smart-title-left2" 
                bgColor="green" 
                h3Title="LET'S CREATE SOMETHING GREAT TOGETHER" 
                h1TitleA="CONTACT" 
                h1TitleB="ME"
            />
            <h3>Email: support@alexisaldrete.com</h3>
        </div>
    )
}

export default ContactInfo;
